import { Component } from 'react';

import logo from './logo.svg';
import './App.css';

class App extends Component {
  constructor() {
    super();
    this.state = {
      monsters: [
        {
          name: 'Luna'
        },
        {
          name: 'Saba'
        },
        {
          name: 'Anna'
        }
      ]
    }
  }
  render() {
    return <div className="App">
    {
      this.state.monsters.map
    }
    </div>;
  }
}

export default App;
